codegen-stable.html.body:
Codegen targetting stable compilerThe current stable Rust release does not support compiler plugins so Serde
codegen needs to be done through a Cargo build
script along with a code generation
framework called Syntex to generate
Serialize and Deserialize implementations. This relatively inconvenient
approach will no longer be necessary as Rust's compiler plugin support matures
in the future.Advantages of this approach: supports stable (released) Rust compiler
versions because it does not depend on features that can only be enabled in the
nightly compiler; also works with nightly.Disadvantages of this approach: one-time setup cost of using a build script;
keeping all Serde types in their own serde_types.rs file is annoying; the
large Syntex dependency increases compilation time; rustc will show certain
types of compiler errors pointing into the nasty generated code rather than to
where the error really is.To start with, here is the Cargo.toml that informs Cargo about the build
script:[package]
name = "my-crate"
version = "0.1.0"
authors = ["Me "]
build = "build.rs"

[build-dependencies]
serde_codegen = "0.8"

[dependencies]
serde = "0.8"
serde_json = "0.8"  # just for the example, not required in general
Next create a file src/serde_types.in.rs to hold all the types for which we
need code generation. No other files should contain #[derive(Serialize,
Deserialize)]. Notice the ".in.rs" extension - this is not going to be used
like a normal module.#[derive(Serialize, Deserialize, Debug)]
struct Point {
    x: i32,
    y: i32,
}
Here is the main code of the program in src/main.rs. The only unusual line
here is the include! line; everything else is just the rest of your crate as
usual.extern crate serde;
extern crate serde_json;

include!(concat!(env!("OUT_DIR"), "/serde_types.rs"));

fn main() {
    let point = Point { x: 1, y: 2 };

    let serialized = serde_json::to_string(&point).unwrap();
    println!("serialized = {}", serialized);

    let deserialized: Point = serde_json::from_str(&serialized).unwrap();
    println!("deserialized = {:?}", deserialized);
}
The last step is to drive the code generation using build.rs. This file goes
in the same directory as Cargo.toml.extern crate serde_codegen;

use std::env;
use std::path::Path;

pub fn main() {
    let out_dir = env::var_os("OUT_DIR").unwrap();

    let src = Path::new("src/serde_types.in.rs");
    let dst = Path::new(&out_dir).join("serde_types.rs");

    serde_codegen::expand(&src, &dst).unwrap();
}
When run, the output is:$ cargo run
serialized = {"x":1,"y":2}
deserialized = Point { x: 1, y: 2 }

codegen-nightly.html.body:
Codegen targetting nightly compilerThe codegen setup for a stable compiler is more complicated
than it needs to be due to compiler plugins being unstable in the current
version of Rust. However if you are using a nightly compiler anyway, you can
use serde_macros which has a much simpler interface. This is a preview of what
the future will look like once compiler plugins are stabilized.Advantages of this approach: trivial to set up - basically just two
#![...] lines; none of the disadvantages of the stable
approach.Disadvantages of this approach: depends on unstable Rust features so it only
works if you are building with a nightly compiler.Here is the Cargo.toml:[package]
name = "my_crate"
version = "0.1.0"
authors = ["Me "]

[dependencies]
serde = "0.8"
serde_json = "0.8"  # just for the example, not required in general
serde_macros = "0.8"
Note that it does not need a build script. Now the src/main.rs which enables
the plugin feature and registers the serde_macros plugin:#![feature(plugin, custom_derive)]
#![plugin(serde_macros)]

extern crate serde_json;

#[derive(Serialize, Deserialize, Debug)]
struct Point {
    x: i32,
    y: i32,
}

fn main() {
    let point = Point { x: 1, y: 2 };

    let serialized = serde_json::to_string(&point).unwrap();
    println!("serialized = {}", serialized);

    let deserialized: Point = serde_json::from_str(&serialized).unwrap();
    println!("deserialized = {:?}", deserialized);
}
Here is the output:$ cargo run
serialized = {"x":1,"y":2}
deserialized = Point { x: 1, y: 2 }

codegen-hybrid.html.body:
Hybrid codegen approachThe stable approach and the nightly
approach both come with significant downsides. This hybrid
approach is similar to the stable approach but enables active development to
happen on nightly in order to receive more useful error messages.Here is the Cargo.toml that depends on serde_codegen by default but exposes
a feature to depend
on serde_macros instead.[package]
name = "testing"
version = "0.1.0"
authors = ["David Tolnay "]
build = "build.rs"

[features]
default = ["serde_codegen"]
unstable = ["serde_macros"]

[build-dependencies]
serde_codegen = { version = "0.8", optional = true }

[dependencies]
serde = "0.8"
serde_json = "0.8"  # just for the example, not required in general
serde_macros = { version = "0.8", optional = true }
The src/serde_types.in.rs is the same as in the stable
approach. This file is the input to the build script and no
other files should contain #[derive(Serialize, Deserialize)].#[derive(Serialize, Deserialize, Debug)]
struct Point {
    x: i32,
    y: i32,
}
Here is the main code of the program in src/main.rs.#![cfg_attr(feature = "serde_macros", feature(plugin, custom_derive))]
#![cfg_attr(feature = "serde_macros", plugin(serde_macros))]

extern crate serde;
extern crate serde_json;

#[cfg(feature = "serde_macros")]
include!("serde_types.in.rs");

#[cfg(feature = "serde_codegen")]
include!(concat!(env!("OUT_DIR"), "/serde_types.rs"));

fn main() {
    let point = Point { x: 1, y: 2 };

    let serialized = serde_json::to_string(&point).unwrap();
    println!("serialized = {}", serialized);

    let deserialized: Point = serde_json::from_str(&serialized).unwrap();
    println!("deserialized = {:?}", deserialized);
}
And here is build.rs which drives the code generation if necessary and
otherwise does nothing, falling back to nightly's support for compiler plugins.
This file goes in the same directory as Cargo.toml.#[cfg(feature = "serde_codegen")]
fn main() {
    extern crate serde_codegen;

    use std::env;
    use std::path::Path;

    let out_dir = env::var_os("OUT_DIR").unwrap();

    let src = Path::new("src/serde_types.in.rs");
    let dst = Path::new(&out_dir).join("serde_types.rs");

    serde_codegen::expand(&src, &dst).unwrap();
}

#[cfg(not(feature = "serde_codegen"))]
fn main() {
    // do nothing
}
To build with stable Rust:$ cargo build
To build with nightly Rust:$ cargo build --no-default-features --features unstable
The nightly compiler will generally produce better error messages so we
recommend doing most of your development that way.

attr-default.html.body:
Default value for a field#![feature(plugin, custom_derive)]
#![plugin(serde_macros)]

extern crate serde;
extern crate serde_json;

#[derive(Deserialize, Debug)]
struct Request {
    // Use the result of a function as the default if "resource" is
    // not included in the input.
    #[serde(default = "default_resource")]
    resource: String,

    // Use the type's implementation of std::default::Default if
    // "timeout" is not included in the input.
    #[serde(default)]
    timeout: Timeout,

    // Use a method from the type as the default if "priority" is not
    // included in the input. This may also be a trait method.
    #[serde(default = "Priority::lowest")]
    priority: Priority,
}

fn default_resource() -> String {
    "/".to_string()
}

/// Timeout in seconds.
#[derive(Deserialize, Debug)]
struct Timeout(u32);
impl Default for Timeout {
    fn default() -> Self {
        Timeout(30)
    }
}

#[derive(Deserialize, Debug)]
enum Priority { ExtraHigh, High, Normal, Low, ExtraLow }
impl Priority {
    fn lowest() -> Self { Priority::ExtraLow }
}

fn main() {
    let json = r#"
        [
          {
            "resource": "/users"
          },
          {
            "timeout": 5,
            "priority": "High"
          }
        ]
    "#;

    let requests: Vec = serde_json::from_str(json).unwrap();

    // The first request has resource="/users", timeout=30, priority=ExtraLow
    println!("{:?}", requests[0]);

    // The second request has resource="/", timeout=5, priority=High
    println!("{:?}", requests[1]);
}

attr-bound.html.body:
Handwritten generic type boundsWhen deriving Serialize and Deserialize implementations for structs with
generic type parameters, most of the time Serde is able to infer the correct
trait bounds without help from the programmer. It uses several heuristics to
guess the right bound, but most importantly it puts a bound of T: Serialize on
every type parameter T that is part of a serialized field and a bound of T:
Deserialize on every type parameter T that is part of a deserialized field.
As with most heuristics, this is not always right and Serde provides an escape
hatch to replace the automatically generated bound by one written by the
programmer.#![feature(plugin, custom_derive)]
#![plugin(serde_macros)]

extern crate serde;
extern crate serde_json;
use serde::de::{self, Deserialize, Deserializer};

use std::fmt::Display;
use std::str::FromStr;

#[derive(Deserialize, Debug)]
struct Outer {
    // When deriving the Deserialize impl, Serde would want to generate a bound
    // `S: Deserialize` on the type of this field. But we are going to use the
    // type's `FromStr` impl instead of its `Deserialize` impl by going through
    // `deserialize_from_str`, so we override the automatically generated bound
    // by the one required for `deserialize_from_str`.
    #[serde(deserialize_with = "deserialize_from_str")]
    #[serde(bound(deserialize = "S: FromStr, S::Err: Display"))]
    s: S,

    // Here Serde would want to generate a bound `T: Deserialize`. That is a
    // stricter condition than is necessary. In fact, the `main` function below
    // uses T=str which does not implement Deserialize. We override the
    // automatically generated bound by a looser one.
    #[serde(bound(deserialize = "Ptr: Deserialize"))]
    ptr: Ptr,
}

/// Deserialize a type `S` by deserializing a string, then using the `FromStr`
/// impl of `S` to create the result. The generic type `S` is not required to
/// implement `Deserialize`.
fn deserialize_from_str(deserializer: &mut D) -> Result
    where S: FromStr,
          S::Err: Display,
          D: Deserializer
{
    let s: String = try!(Deserialize::deserialize(deserializer));
    S::from_str(&s).map_err(|e| de::Error::custom(e.to_string()))
}

/// A pointer to `T` which may or may not own the data. When deserializing we
/// always want to produce owned data.
#[derive(Debug)]
enum Ptr {
    Ref(&'a T),
    Owned(Box),
}

impl Deserialize for Ptr
    where Box: Deserialize
{
    fn deserialize(deserializer: &mut D) -> Result
        where D: Deserializer
    {
        let box_t = try!(Deserialize::deserialize(deserializer));
        Ok(Ptr::Owned(box_t))
    }
}

fn main() {
    let j = r#"
        {
          "s": "1234567890",
          "ptr": "owned"
        }
    "#;

    let result: Outer = serde_json::from_str(j).unwrap();

    // result = Outer { s: 1234567890, ptr: Owned("owned") }
    println!("result = {:?}", result);
}

deserialize-map.html.body:
Implement Deserialize for a custom map type// A Visitor is a type that holds methods that a Deserializer can drive
// depending on what is contained in the input data.
//
// In the case of a map we need generic type parameters K and V to be
// able to set the output type correctly, but don't require any state.
// This is an example of a "zero sized type" in Rust. The PhantomData
// keeps the compiler from complaining about unused generic type
// parameters.
struct MyMapVisitor {
    marker: PhantomData>
}

impl MyMapVisitor {
    fn new() -> Self {
        MyMapVisitor {
            marker: PhantomData
        }
    }
}

// This is the trait that Deserializers are going to be driving. There
// is one method for each type of data that our type knows how to
// deserialize from. There are many other methods that are not
// implemented here, for example deserializing from integers or strings.
// By default those methods will return an error, which makes sense
// because we cannot deserialize a MyMap from an integer or string.
impl de::Visitor for MyMapVisitor
    where K: Deserialize,
          V: Deserialize
{
    // The type that our Visitor is going to produce.
    type Value = MyMap;

    // Deserialize MyMap from an abstract "map" provided by the
    // Deserializer. The MapVisitor input is a callback provided by
    // the Deserializer to let us see each entry in the map.
    fn visit_map(&mut self, mut visitor: M) -> Result
        where M: de::MapVisitor
    {
        let mut values = MyMap::with_capacity(visitor.size_hint().0);

        // While there are entries remaining in the input, add them
        // into our map.
        while let Some((key, value)) = try!(visitor.visit()) {
            values.insert(key, value);
        }

        try!(visitor.end());
        Ok(values)
    }

    // As a convenience, provide a way to deserialize MyMap from
    // the abstract "unit" type. This corresponds to `null` in JSON.
    // If your JSON contains `null` for a field that is supposed to
    // be a MyMap, we interpret that as an empty map.
    fn visit_unit(&mut self) -> Result
        where E: de::Error
    {
        Ok(MyMap::new())
    }
}

// This is the trait that informs Serde how to deserialize MyMap.
impl Deserialize for MyMap
    where K: Deserialize,
          V: Deserialize
{
    fn deserialize(deserializer: &mut D) -> Result
        where D: Deserializer
    {
        // Instantiate our Visitor and ask the Deserializer to drive
        // it over the input data, resulting in an instance of MyMap.
        deserializer.deserialize_map(MyMapVisitor::new())
    }
}

serialize-map.html.body:
Implement Serialize for a custom map typeimpl Serialize for MyMap
    where K: Serialize,
          V: Serialize
{
    fn serialize(&self, serializer: &mut S) -> Result
        where S: Serializer
    {
        let mut state = try!(serializer.serialize_map(Some(self.len())));
        for (k, v) in self {
            try!(serializer.serialize_map_key(&mut state, k));
            try!(serializer.serialize_map_value(&mut state, v));
        }
        serializer.serialize_map_end(state)
    }
}

stream-array.html.body:
Process an array of values without buffering into a VecSuppose we have an array of integers and we want to figure out the maximum value
without holding the whole array in memory all at once. This approach can be
adapted to handle a variety of other situations in which data needs to be
processed while being deserialized instead of after.#![feature(custom_derive, plugin)]
#![plugin(serde_macros)]

extern crate serde;
extern crate serde_json;
use serde::{de, Deserialize, Deserializer};

use std::cmp;
use std::marker::PhantomData;

#[derive(Deserialize)]
struct Outer {
    id: String,

    // Deserialize this field by computing the maximum value of a sequence
    // (JSON array) of values.
    #[serde(deserialize_with = "deserialize_max")]
    // Despite the struct field being named `max_value`, it is going to come
    // from a JSON field called `values`.
    #[serde(rename(deserialize = "values"))]
    max_value: u64,
}

/// Deserialize the maximum of a sequence of values. The entire sequence
/// is not buffered into memory as it would be if we deserialize to Vec
/// and then compute the maximum later.
///
/// This function is generic over T which can be any type that implements
/// Ord. Above, it is used with T=u64.
fn deserialize_max(deserializer: &mut D) -> Result
    where T: Deserialize + Ord,
          D: Deserializer
{
    struct MaxVisitor(PhantomData);

    impl de::Visitor for MaxVisitor
        where T: Deserialize + Ord
    {
        /// Return type of this visitor. This visitor computes the max of a
        /// sequence of values of type T, so the type of the maximum is T.
        type Value = T;

        fn visit_seq(&mut self, mut visitor: V) -> Result
            where V: de::SeqVisitor
        {
            // Start with max equal to the first value in the seq.
            let mut max = match try!(visitor.visit()) {
                Some(value) => value,
                None => {
                    // Cannot take the maximum of an empty seq.
                    let msg = "no values in seq when looking for maximum";
                    return Err(de::Error::custom(msg));
                }
            };

            // Update the max while there are additional values.
            while let Some(value) = try!(visitor.visit()) {
                max = cmp::max(max, value);
            }

            try!(visitor.end());
            Ok(max)
        }
    }

    // Create the visitor and ask the deserializer to drive it. The
    // deserializer will call visitor.visit_seq if a seq is present in
    // the input data.
    let visitor = MaxVisitor(PhantomData);
    deserializer.deserialize_seq(visitor)
}

fn main() {
    let j = r#"
        {
          "id": "demo-deserialize-max",
          "values": [
            256,
            100,
            384,
            314,
            271
          ]
        }
    "#;

    let out: Outer = serde_json::from_str(j).unwrap();

    // Prints "max value: 384"
    println!("max value: {}", out.max_value);
}

enum-str.html.body:
Serialize enum as stringextern crate serde;
extern crate serde_json;

macro_rules! enum_str {
    ($name:ident { $($variant:ident($str:expr), )* }) => {
        #[derive(Clone, Copy, Debug, Eq, PartialEq)]
        pub enum $name {
            $($variant,)*
        }

        impl ::serde::Serialize for $name {
            fn serialize(&self, serializer: &mut S) -> Result
                where S: ::serde::Serializer,
            {
                // Serialize the enum as a string.
                serializer.serialize_str(match *self {
                    $( $name::$variant => $str, )*
                })
            }
        }

        impl ::serde::Deserialize for $name {
            fn deserialize(deserializer: &mut D) -> Result
                where D: ::serde::Deserializer,
            {
                struct Visitor;

                impl ::serde::de::Visitor for Visitor {
                    type Value = $name;

                    fn visit_str(&mut self, value: &str) -> Result
                        where E: ::serde::de::Error,
                    {
                        match value {
                            $( $str => Ok($name::$variant), )*
                            _ => Err(E::invalid_value(
                                &format!("unknown {} variant: {}",
                                stringify!($name), value))),
                        }
                    }
                }

                // Deserialize the enum from a string.
                deserializer.deserialize_str(Visitor)
            }
        }
    }
}

enum_str!(LanguageCode {
    English("en"),
    Spanish("es"),
    Italian("it"),
    Japanese("ja"),
    Chinese("zh"),
});

fn main() {
    use LanguageCode::*;
    let languages = vec![English, Spanish, Italian, Japanese, Chinese];

    // Prints ["en","es","it","ja","zh"]
    println!("{}", serde_json::to_string(&languages).unwrap());

    let input = r#" "ja" "#;
    assert_eq!(Japanese, serde_json::from_str(input).unwrap());
}

enum-number.html.body:
Serialize enum as numberextern crate serde;
extern crate serde_json;

macro_rules! enum_number {
    ($name:ident { $($variant:ident = $value:expr, )* }) => {
        #[derive(Clone, Copy, Debug, Eq, PartialEq)]
        pub enum $name {
            $($variant = $value,)*
        }

        impl ::serde::Serialize for $name {
            fn serialize(&self, serializer: &mut S) -> Result
                where S: ::serde::Serializer,
            {
                // Serialize the enum as a u64.
                serializer.serialize_u64(*self as u64)
            }
        }

        impl ::serde::Deserialize for $name {
            fn deserialize(deserializer: &mut D) -> Result
                where D: ::serde::Deserializer,
            {
                struct Visitor;

                impl ::serde::de::Visitor for Visitor {
                    type Value = $name;

                    fn visit_u64(&mut self, value: u64) -> Result
                        where E: ::serde::de::Error,
                    {
                        // Rust does not come with a simple way of converting a
                        // number to an enum, so use a big `match`.
                        match value {
                            $( $value => Ok($name::$variant), )*
                            _ => Err(E::invalid_value(
                                &format!("unknown {} value: {}",
                                stringify!($name), value))),
                        }
                    }
                }

                // Deserialize the enum from a u64.
                deserializer.deserialize_u64(Visitor)
            }
        }
    }
}

enum_number!(SmallNumber {
    Zero = 0,
    One = 1,
    Two = 2,
    Three = 3,
});

fn main() {
    use SmallNumber::*;
    let nums = vec![Zero, One, Two, Three];

    // Prints [0,1,2,3]
    println!("{}", serde_json::to_string(&nums).unwrap());

    assert_eq!(Two, serde_json::from_str("2").unwrap());
}

